import React from "react";
import {Link} from "react-router-dom";

const Footer = () => {
  return(
    <footer className="footer">
      <Link className="footer-link" to="/" style={{float: "left"}}>Home</Link>
      <Link className="footer-link" to="/order" style={{marginLeft: "100px"}}>Order</Link>
      <Link className="footer-link" to="/checkout" style={{float: "right"}}>Checkout</Link>
    </footer>
  );
}

export default Footer;
